import { useEffect } from "react";
import LoggedinContainer from "../containers/Loggedincontainers";
import { makeAuthenticatedGETRequest } from "../utils/serverhelper";

const Library = () => {

useEffect(()=>{
    const getData =async () =>{
        const response = await makeAuthenticatedGETRequest("/playlist/get/me");
        console.log(response)
    };
    getData();
},[])

    return (

        <LoggedinContainer currentactivescreen="library" >
                <div className="text-white text-xl pt-8">
                    My Playlist
                </div>
                <div className="py-5 grid gap-4 grid-cols-5">
             
                </div>
        </LoggedinContainer>
    )
}

const Card = ({ title, description, imgurl }) => {
    return (
        <div className="bg-black bg-opacity-50 w-full p-4 rounded-lg">
            <div className="py-4">
                <img className="w-full rounded-md" alt="card" src={imgurl} />
            </div>
            <div className="text-white  py-3">{title}</div>
            <div className="text-gray-500 text-sm">{description}</div>

        </div>
    );
};


export default Library;
